  [],\n\t\"revision_timestamp\": \"2016-07-27T22:57:27.707024\",\n\t\"name\": \"waubay-wetland-management-district-annual-narrative-report-calendar-year-1977\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Waubay
  Wetland Management District outlines Refuge accomplishments during the 1977 calendar
  year. The report begins by summarizing the climate and habitat conditions, land
  acquisition, and systems status during the year. Construction and maintenance are
  discussed. Habitat management topics are described, including croplands, grasslands,
  wetlands, and easements for waterfowl management. Wildlife- including migratory
  birds, marsh and water birds, shorebirds, raptors, other migratory birds, game animals,
  other mammals, and resident birds- is also covered. Interpretation and recreation
  topics are discussed; details on information and interpretation, recreation, and
  law enforcement are given. A progress report on field investigations and applied
  research is also provided. Cooperative programs and items of interest are included.\",\n\t\"license_title\":
